import { Box, Heading, Image, Text } from "@chakra-ui/react";
import { useRouter } from "next/router";

export default function VideoPage() {
  const router = useRouter();
  const { id } = router.query;

  return (
    <Box p={4}>
      <Heading>Video</Heading>
      <Text>{id}</Text>
    </Box>
  );
}
